import React from "react";
import './Pagetwo.css';
function Pagetwo (){
    return (
        <div className="pagetwo">
            <p>Here how it works</p>
            <h3 style={{fontFamily:'Open Sans', fontWeight:'700', fontSize:'36px'}}>Simple process to start</h3>
        </div>
    );
};

export default Pagetwo;
